import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router } from 'react-router-dom';
import MainNavBar from './main/MainNavBar';
import AdminNavBar from './admin/AdminNavBar';
import CustomerNavBar from './components/NavBar';
import SellerNavBar from './Sellermenu/Scomponents/SellersNavBar';
import NavBar from './components/NavBar';

export default function App() {
  const [isAdminLoggedIn, setIsAdminLoggedIn] = useState(false);
  const [isCustomerLoggedIn, setIsCustomerLoggedIn] = useState(false);
  const [isRecruiterLoggedIn, setIsRecruiterLoggedIn] = useState(false);

   useEffect(() => {
    const adminLoggedIn = localStorage.getItem('isAdminLoggedIn') === 'true';
    const customerLoggedIn = localStorage.getItem('isCustomerLoggedIn') === 'true';
  const recruiterLoggedIn = localStorage.getItem('isRecruiterLoggedIn') === 'true';

    setIsAdminLoggedIn(adminLoggedIn);
     setIsCustomerLoggedIn(customerLoggedIn);
    setIsRecruiterLoggedIn(recruiterLoggedIn);
   }, []);

  const onAdminLogin = () => {
    localStorage.setItem('isAdminLoggedIn', 'true');
    setIsAdminLoggedIn(true);
  };

  const onCustomerLogin = () => {
    localStorage.setItem('isJobSeekerLoggedIn', 'true');
    setIsCustomerLoggedIn(true);
  };

  const onRecruiterLogin = () => {
    localStorage.setItem('isRecruiterLoggedIn', 'true');
    setIsRecruiterLoggedIn(true);
  };

  return (
    <div className="App">
      <h3 align="center">Online Job Portal</h3>
      <Router>
        {isAdminLoggedIn ? (
          <AdminNavBar />
        ) : isCustomerLoggedIn ? (
           <CustomerNavBar/>
        ) : isRecruiterLoggedIn ? (
          <RecruiterNavBar />
        ) : (
          <MainNavBar
            onAdminLogin={onAdminLogin}
            onCustomerLogin={onCustomerLogin}
            onSellerLogin={onSellerLogin}
          />
        )}
      </Router>
    </div>
  );
}
